alexEOF :: Alex Token
alexEOF = do
  (p, _, _, _) <- alexGetInput
  return $ Token p TEOF

isEOF :: Token -> Bool
isEOF (Token _ TEOF) = True
isEOF _              = False

scanner :: String -> Either String [Token]
scanner str = 
  let loop = do
        tok <- alexMonadScan
        if isEOF tok
          then return []
          else do toks <- loop; return (tok:toks)
  in runAlex str loop

main :: IO ()
main = do
  s <- getContents
  case (scanner s) of
    Left msg -> putStrLn msg
    Right tokns -> mapM_ (putStrLn . show) tokns



